import React from "react";
import { useNavigate } from "react-router-dom";

function Home() {
    const navigate = useNavigate();

    // Handle navigation to Sign In and Register pages
    const handleSignIn = () => {
        navigate("/signin");
    };

    const handleRegister = () => {
        navigate("/register");
    };

    return (
        <div style={styles.container}>
            <h1 style={styles.title}>MedCo</h1>

            <div style={styles.buttonsContainer}>
                {/* Sign In Button */}
                <button onClick={handleSignIn} style={styles.button}>
                    Sign In
                </button>

                {/* Register Button */}
                <button onClick={handleRegister} style={{ ...styles.button, ...styles.registerButton }}>
                    Register
                </button>
            </div>
        </div>
    );
}

// Inline Styles
const styles = {
    container: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
        backgroundColor: "#e0f7f7", // Background color matching your design
    },
    title: {
        fontSize: "2rem",
        color: "#008080", // Teal color for the title
        marginBottom: "20px",
    },
    buttonsContainer: {
        display: "flex",
        justifyContent: "center",
        gap: "20px", // Space between buttons
    },
    button: {
        padding: "10px 20px",
        fontSize: "16px",
        backgroundColor: "#008080",
        color: "white",
        border: "none",
        borderRadius: "5px",
        cursor: "pointer",
    },
    registerButton: {
        backgroundColor: "#006666", // Darker shade for the Register button
    },
};

export default Home;
